import { getUserProfile } from "../lib/auth.js";

class profile extends Component {
  state = {
    user: null,
  };
  componentDidMount() {
    getUserProfile().then((user) => this.setState({ user }));
  }

  render() {
    return <div>{JSON.stringify(this.state.user, null, 2)}</div>;
  }
}

export default profile;
